import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <div className="case">
            <div className="phone">
            <div   div class="grid-container">
                <div class="item1">
                    <div id="clock" class="time"></div>
                    <div class="camera">
                        <div class="cam"></div>
                    </div>
                    <div class="battery">30%</div>
                </div>
            </div>
      </div>
      </div>


      </header>
    </div>
  );
}

export default App;
